import React, { Fragment } from 'react';

import Main_Image from '../components/Main_Image';
import Footer from '../components/Footer';
const HomeFirst = () => {
  return (
    <Fragment>
      <Main_Image />
      <Footer />
    </Fragment>
  );
};

export default HomeFirst;
